/**
 * @notice Key sets with enumeration and delete. Uses mappings for random
 * and existence checks and dynamic arrays for enumeration. Key uniqueness is enforced. 
 * @dev Sets are unordered. Delete operations reorder keys. All operations have a 
 * fixed gas cost at any scale, O(1). 
 * author: Rob Hitchens
 */

library AddressSet {

    struct Set {
        mapping(address => uint) keyPointers;
        address[] keyList;
    }

    /**
     * @notice insert a key. 
     * @dev duplicate keys are not permitted.
     * @param self storage pointer to a Set. 
     * @param key value to insert.
     */    
    function insert(Set storage self, address key) internal {
        require(!exists(self, key), "AddressSet: key already exists in the set.");
        self.keyList.push(key);
        self.keyPointers[key] = self.keyList.length - 1;
    }

    /**
     * @notice remove a key.
     * @dev key to remove must exist. 
     * @param self storage pointer to a Set.
     * @param key value to remove.
     */    
    function remove(Set storage self, address key) internal {
        require(exists(self, key), "AddressSet: key does not exist in the set.");
        uint last = count(self) - 1;
        uint rowToReplace = self.keyPointers[key];
        if(rowToReplace != last) {
            address keyToMove = self.keyList[last];
            self.keyPointers[keyToMove] = rowToReplace;
            self.keyList[rowToReplace] = keyToMove;
        }
        delete self.keyPointers[key];
        self.keyList.pop();
    }

    /**
     * @notice count the keys.
     * @param self storage pointer to a Set. 
     */       
    function count(Set storage self) internal view returns(uint) {
        return(self.keyList.length);
    }

    /**
     * @notice check if a key is in the Set.
     * @param self storage pointer to a Set.
     * @param key value to check. 
     * @return bool true: Set member, false: not a Set member.
     */  
    function exists(Set storage self, address key) internal view returns(bool) {
        if(self.keyList.length == 0) return false;
        return self.keyList[self.keyPointers[key]] == key;
    }

    /**
     * @notice fetch a key by row (enumerate).
     * @param self storage pointer to a Set.
     * @param index row to enumerate. Must be < count() - 1.
     */      
    function keyAtIndex(Set storage self, uint index) internal view returns(address) {
        return self.keyList[index];
    }
}

contracts/Campaign.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.5.0;
import "./CampaignFactory.sol";
import "./Reputation.sol";

contract Campaign {
    string campaignName;
    string organisationUrl;
    uint64 endTimestamp;
    address payable beneficiaryAddress;
    address campaignOwnerAddress;
    uint256 targetDonationAmount;
    string campaignDescription;

    CampaignFactory origin;

    // Default starting donated sum
    uint256 totalDonationAmount = 0;

    event Donate(address donorAddress, uint256 amount);
    event Withdraw(
        address withdrawerAddress,
        uint256 amount,
        address toAddress
    );

    constructor(
        string memory _campaignName,
        string memory _organisationUrl,
        uint64 _endTimestamp,
        address payable _beneficiaryAddress,
        address _campaignOwnerAddress,
        uint256 _targetDonationAmount,
        string memory _campaignDescription
    ) {
        campaignName = _campaignName;
        organisationUrl = _organisationUrl;
        endTimestamp = _endTimestamp;
        beneficiaryAddress = _beneficiaryAddress;
        campaignOwnerAddress = _campaignOwnerAddress;
        targetDonationAmount = _targetDonationAmount;
        campaignDescription = _campaignDescription;
        origin = CampaignFactory(msg.sender);
    }

    // Checks if the donation value is not zero.
    modifier notZeroDonationValue(uint256 value) {
        require(
            value > 0,
            "Value of 0 donated..."
        );
        _;
    }

    // Checks if the withdrawer's address belongs
    // to the campaign owner or the beneficiary.
    modifier equalsCampaignOwnerOrBeneficary(address withdrawerAddress) {
        bool isCampaignOwnerAddress = withdrawerAddress == campaignOwnerAddress;
        bool isBeneficiaryAddress = withdrawerAddress == beneficiaryAddress;
        require(
            isCampaignOwnerAddress || isBeneficiaryAddress,
            "Not owner or beneficiary..."
        );
        _;
    }

    // Checks if there is enough donation balance available for withdrawing.
    modifier hasAvailableDonationBalance(uint256 value) {
        require(
            address(this).balance >= value,
            "Not enough balance..."
        );
        _;
    }

    // Checks if the donation made is to an expired campaign.
    modifier noExpiredDonations() {
      require(
          endTimestamp / 1000 > block.timestamp,
          "Cannot donate to expired campaign..."
      );
      _;
    }

    // Checks if donor is not beneficiary.
    modifier noDonationAsBeneficiary() {
      require(
        beneficiaryAddress != msg.sender,
        "Cannot donate to own dedicated campaign..."
      );
      _;
    }

    // Donates eth to the campaign. The ether is held in this contract.
    function donate()
        public
        payable
        noDonationAsBeneficiary()
        noExpiredDonations()
        notZeroDonationValue(msg.value)
    {
        totalDonationAmount += msg.value;
        emit Donate(msg.sender, msg.value);
        origin.emitDonateEvent(msg.sender, msg.value);

        // Update reputation
        origin.updateReputation(beneficiaryAddress, msg.value);
    }

    // Withdraws the specified eth amount from this campaign contract.
    function withdraw(uint256 amount)
        public
        payable
        equalsCampaignOwnerOrBeneficary(msg.sender)
        hasAvailableDonationBalance(amount)
    {
        beneficiaryAddress.transfer(amount);
        emit Withdraw(msg.sender, amount, beneficiaryAddress);
        origin.emitWithdrawEvent(msg.sender, amount, beneficiaryAddress);
    }

    function getCampaignName() public view returns (string memory) {
        return campaignName;
    }

    function getOrganisationUrl() public view returns (string memory) {
        return organisationUrl;
    }

    function getEndTimeStamp() public view returns (uint64) {
        return endTimestamp;
    }

    function getBeneficiaryAddress() public view returns (address) {
        return beneficiaryAddress;
    }

    function getCampaignOwnerAddress() public view returns (address) {
        return campaignOwnerAddress;
    }

    function getTargetDonationAmount() public view returns (uint256) {
        return targetDonationAmount;
    }

    function getTotalDonationAmount() public view returns (uint256) {
        return totalDonationAmount;
    }

    function getCampaignDescription() public view returns (string memory) {
        return campaignDescription;
    }

    function getWithdrawalBalance() public view returns (uint256) {
        return address(this).balance;
    }
}

contracts/CampaignFactory.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.5.0;
import "./Campaign.sol";
import "./AddressSet.sol";
import "./Reputation.sol";

contract CampaignFactory {
    using AddressSet for AddressSet.Set;

    address owner;
    Reputation reputation;

    event CampaignStarted(address ownerAddress, address campaignAddress);
    event Donate(address campaignAddress, address donorAddress, uint256 amount);
    event Withdraw(
        address campaignAddress,
        address withdrawerAddress,
        uint256 amount,
        address toAddress
    );

    AddressSet.Set createdCampaigns;

    constructor() payable {
        require(
            msg.value >= 0.01 ether,
            "CampaignFactory must be deployed with 0.01 ETH"
        );

        owner = msg.sender;
    }

    // Set Reputation address
    function setReputationAddress(address _reputationAddress) public {
        require(
            msg.sender == owner,
            "Only owner can set the Reputation address"
        );
        reputation = Reputation(_reputationAddress);
    }

    // Checks if campaign end timestamp is in the future
    modifier isValidEndTimestamp(uint64 endTimestamp) {
        require(
            endTimestamp > block.timestamp,
            "Campaign end date must be in the future"
        );
        require(
            endTimestamp <= 8640000000000000,
            "Campaign end date must not be after the max date in Javascript"
        );
        _;
    }

    // Checks if campaign target donation amount is above or equals zero
    modifier isValidTargetDonation(uint256 targetDonationAmount) {
        require(
            targetDonationAmount >= 0,
            "Target donation amount must be >= 0 ETH"
        );
        _;
    }

    // Checks if caller is a Campaign created from this CampaignFactory
    modifier isBelongToCampaignFactory(address caller) {
        require(
            createdCampaigns.exists(caller), 
            "Sender must be a Campaign created from this CampaignFactory"
        );
        _;
    }

    // Deploys a new campaign contract with user provided data
    function startCampaign(
        string memory _campaignName,
        string memory _organisationUrl,
        uint64 _endTimestamp,
        address payable _beneficiaryAddress,
        address _campaignOwnerAddress,
        uint256 _targetDonationAmount,
        string memory _campaignDescription
    )
        public
        isValidEndTimestamp(_endTimestamp)
        isValidTargetDonation(_targetDonationAmount)
        returns (address)
    {
        // Create new campaign contract
        Campaign newCampaign = new Campaign(
            _campaignName,
            _organisationUrl,
            _endTimestamp,
            _beneficiaryAddress,
            _campaignOwnerAddress,
            _targetDonationAmount,
            _campaignDescription
        );

        // Add new campaign to set of created campaigns
        createdCampaigns.insert(address(newCampaign));

        emit CampaignStarted(_campaignOwnerAddress, address(newCampaign));
        return address(newCampaign);
    }

    function emitDonateEvent(address donorAddress, uint256 amount) 
        public 
        isBelongToCampaignFactory(msg.sender) 
    {
        emit Donate(msg.sender, donorAddress, amount);
    }

    function emitWithdrawEvent(address withdrawerAddress, uint256 amount, address beneficiaryAddress)
        public
        isBelongToCampaignFactory(msg.sender) 
    {
        emit Withdraw(msg.sender, withdrawerAddress, amount, beneficiaryAddress);
    }

    function updateReputation(address beneficiaryAddress, uint256 value)
        public
        isBelongToCampaignFactory(msg.sender)
    {
        reputation.updateReputation(beneficiaryAddress, value);
    }
}

